properties.property:
EVENTSTART
Name:LimitedCheck
Source:^Limited_Check1$
SCRIPTSTART
var face1= presenter.playerController.getModule('Image1');

var AudioWrong = presenter.playerController.getModule('AudioWrong');
var AudioAward= presenter.playerController.getModule('AudioAward');


if(event.score==event.maxScore && event.errors==0){

AudioWrong.stop();
AudioAward.stop();
AudioAward.play();
face1.show();

}
else if(event.score<=event.maxScore && event.errors!=0) {
AudioWrong.stop();
AudioAward.stop();
AudioWrong.play();
face1.hide();
}


else if(event.score<=event.maxScore && event.errors==0) {
AudioWrong.stop();
AudioAward.stop();
face1.hide();
}

SCRIPTEND
EVENTEND

